//Object Constructor function to store city data
function City(city, state, colIndex, income, grocery, housing, utilities, transportation,
  healthcare, miscellaneous, longitude, latitude) { //do we need parameters??
  this.city = city;
  this.state = state;
  this.colIndex = colIndex;
  this.income = income; //this is the avg annual base income required to live
  this.grocery = grocery;
  this.housing = housing;
  this.utilities = utilities;
  this.transportation = transportation;
  this.healthcare = healthcare;
  this.miscellaneous = miscellaneous;
  this.longitude = longitude;
  this.latitude = latitude;
};

